import React, { Component } from "react";
import ReactDOM from "react-dom";
import "antd/dist/antd.css";
import { Form, Input, Button, Checkbox } from "antd";
class SignUp extends Component {
  constructor(props) {
    super(props);
  }
  state = { username: "sai", password: "" };
  signup = () => {
    console.log(Form.useForm.username);
  };
  render() {
    return (
      <>
        <Form
          name="basic"
          labelCol={{
            span: 8,
          }}
          wrapperCol={{
            span: 8,
          }}
          initialValues={{
            remember: true,
          }}
          autoComplete="off"
        >
          <Form.Item
            label="Username"
            name="username"
            rules={[
              {
                required: true,
                message: "Please input your username!",
              },
            ]}
          >
            <Input value={this.state.username} />
          </Form.Item>

          <Form.Item
            label="Password"
            name="password"
            rules={[
              {
                required: true,
                message: "Please input your password!",
              },
            ]}
          >
            <Input.Password />
          </Form.Item>

          <Form.Item
            wrapperCol={{
              offset: 8,
              span: 8,
            }}
          >
            <Button
              type="primary"
              htmlType="submit"
              onClick={() => this.signup()}
            >
              Submit
            </Button>
          </Form.Item>
        </Form>
      </>
    );
  }
}

export default SignUp;
